import Nav from '../nav-bar/Nav'
import "./style.css";
function Logic() {
    return (
        <div>
            <Nav />

            <div className='parent-div'>
                <div className='centered-div'>
                    <h1>Hello There</h1>
                </div>
            </div>
        </div>
    )
}

export default Logic
